Dijkstra's algorithm is used to find the shortest path between two nodes in a weighted, directed graph (not necessarily connected). Here are the steps:

1. Initialize a priority queue with the starting node and set its distance from the starting node to 0.
2. While the priority queue is not empty:
a. Dequeue the node with the smallest distance from the starting node.
b. For each unvisited neighbor of the dequeued node, calculate the tentative distance to that neighbor using the current distance from the starting node plus the weight of the edge between them. If this is less than the previously calculated distance, update the distance and add the node to the priority queue.
3. Return the distance from the starting node to the ending node or return "no path exists" if there is no path to the ending node.

Here is an example of Dijkstra's algorithm in JavaScript:
```
function dijkstra(graph, start) {
  const distances = {}; // initialized with Infinity values
  const previous = {}; // initialized as undefined values
  let queue = []; // priority queue implemented using a heap
  const visited = new Set(); // set of visited nodes

  distances[start] = 0;
  previous[start] = null;
  queue.push(start);

  while (queue.length > 0) {
    const node = queue.pop();
    if (!visited.has(node)) {
      visited.add(node);
      const neighbors = graph[node]; // get the list of neighboring nodes for this node
      for (const neighbor of neighbors) {
        if (distances[neighbor] === Infinity || distances[neighbor] > distances[node] + weight(node, neighbor)) {
          distances[neighbor] = distances[node] + weight(node, neighbor);
          previous[neighbor] = node;
        }
      }
    }
  }

  return distances;
}
```
For example, if we have a graph with weights of `weight(u, v) = w(u, v)` for each edge `(u, v)`, where the weight of an edge is its length, then Dijkstra's algorithm will find the shortest path between two nodes by first calculating the shortest distance from one node to all other nodes, and then using this information to find the shortest path from the starting node to the ending node.

In summary, Dijkstra's algorithm is a greedy algorithm that finds the shortest path between two nodes in a weighted graph by iteratively selecting the unvisited node with the smallest distance from the starting node and updating its distance to the nearest neighbor if it is closer than any previously found distance. This continues until all nodes have been visited, at which point the shortest path from the starting node to the ending node has been found.

