[PYTHON]
def dijkstra(graph, start):
    # create a dictionary for the shortest distances and another for the previous nodes
    distances = {node: float('inf') for node in graph}
    previous = {node: None for node in graph}

    # add the starting point and set its distance to 0
    distances[start] = 0
    previous[start] = None

    # loop until all points have been visited
    while True:
        # find the unvisited point with the smallest distance
        node = min(filter(lambda n: distances[n] != float('inf'), graph), key=lambda n: distances[n])

        # if we've visited every point, stop
        if node is None:
            break

        # mark the current point as visited
        distances[node] = float('inf')

        # update the distances and previous nodes for all adjacent points
        for neighbor in graph[node]:
            if distances[neighbor] > distances[node] + 1:
                distances[neighbor] = distances[node] + 1
                previous[neighbor] = node

    # return the previous nodes and distances dictionary
    return previous, distances
