 Dijkstra's algorithm is an efficient solution for finding the shortest path from a single starting node to all other nodes in a weighted, directed graph. However, it can be easily adapted to find the shortest path between any two given nodes. Here's how you can do that:

1. Implement Dijkstra's algorithm as usual, maintaining a priority queue and updating the distances of adjacent vertices when needed. Stop when you have found the shortest distance from the source node to the target node.

2. If you want to find only the shortest path between two specific nodes, then follow these steps:

   a. Run Dijkstra's algorithm starting at the first node (source) until it finishes processing and finds the shortest distances to all other nodes.

   b. Once the algorithm is complete, examine the array containing the shortest distances. You will find the shortest distance from the source node to any other node in this array.

   c. Now run Dijkstra's algorithm again, but this time start at the target node (the second node) and let it run until it finishes processing.

   d. After the second run of the algorithm, examine the shortestPath[] array to see which nodes were reached from the target node. The index with the smallest value in this array will be the previous node in the shortest path.

   e. To reconstruct the entire shortest path, starting from the source node and ending at the target node, follow these steps:
      - Start by adding the source node to the path.
      - While the current node is not the target node, look at its adjacent nodes in the graph. The next node in the shortest path will be the one with the smallest distance value in the shortestPath[] array that hasn't been added to the path yet.
      - Add this next node to the path and continue until you reach the target node.

Here is a Java implementation of Dijkstra's algorithm for finding the shortest path between two nodes:

```java
import java.util.*;

class Edge {
    int dest;
    int weight;

    public Edge(int dest, int weight) {
        this.dest = dest;
        this.weight = weight;
    }
}

public class DijkstraShortestPath {

    private static final int INF = Integer.MAX_VALUE;

    public static void main(String[] args) {
        List<Edge>[] graph = new LinkedList[6];
        for (int i = 0; i < 6; i++) {
            graph[i] = new ArrayList<>();
        }

        addEdge(graph, 0, 1, 4);
        addEdge(graph, 0, 2, 2);
        addEdge(graph, 1, 2, 5);
        addEdge(graph, 1, 3, 10);
        addEdge(graph, 2, 4, 3);
        addEdge(graph, 3, 4, 1);
        addEdge(graph, 3, 5, 6);
        addEdge(graph, 4, 5, 8);

        int source = 0;
        int target = 5;

        int[] dist = dijkstra(graph, source);
        int shortestDistance = dist[target];

        List<Integer> path = new ArrayList<>();
        if (shortestDistance < INF) {
            int[] parent = new int[6];
            Arrays.fill(parent, -1);
            findShortestPath(graph, target, parent);

            int currentNode = target;
            while (currentNode != source) {
                path.add(currentNode);
                currentNode = parent[currentNode];
            }
            path.add(source);
        }

        System.out.println("The shortest distance is: " + shortestDistance);
        System.out.println("The shortest path is: " + path);
    }

    private static void addEdge(List<Edge>[] graph, int src, int dest, int weight) {
        graph[src].add(new Edge(dest, weight));
        graph[dest].add(new Edge(src, weight)); // For undirected graph
    }

    private static int[] dijkstra(List<Edge>[] graph, int src) {
        int n = graph.length;
        int[] dist = new int[n];
        boolean[] visited = new boolean[n];

        Arrays.fill(dist, INF);
        dist[src] = 0;

        PriorityQueue<Edge> pq = new PriorityQueue<>(Comparator.comparingInt(e -> e.weight));
        pq.add(new Edge(src, 0));

        while (!pq.isEmpty()) {
            int u = pq.poll().dest;

            if (visited[u]) continue;
            visited[u] = true;

            for (Edge edge : graph[u]) {
                int v = edge.dest;
                int weight = edge.weight;

                if (!visited[v] && dist[u] + weight < dist[v]) {
                    dist[v] = dist[u] + weight;
                    pq.add(new Edge(v, dist[v]));
                }
            }
        }

        return dist;
    }

    private static void findShortestPath(List<Edge>[] graph, int currentNode, int[] parent) {
        if (currentNode == -1) return;

        findShortestPath(graph, parent[currentNode], parent);

        // Add the edge between the current node and its previous node in the path
        Edge edge = null;
        for (Edge e : graph[currentNode]) {
            if (e.dest == parent[currentNode]) {
                edge = e;
                break;
            }
        }

        System.out.print(edge.weight + "(" + currentNode + ", " + parent[currentNode] + ") ");
    }
}
```

