class Expense:
    def __init__(self, category, amount):
        self.category = category
        self.amount = amount

class User:
    def __init__(self, income):
        self.income = income
        self.essentials_percentage = 0.5
        self.savings_percentage = 0.2
        self.discretionary_spending_percentage = 0.3
        self.expenses = {
            "essentials": [],
            "savings": [],
            "discretionary_spending": []
        }

    def add_expense(self, category, amount):
        if category == "essentials" or category == "savings" or category == "discretionary_spending":
            self.expenses[category].append(Expense(category, amount))
        else:
            print("Invalid category. Please choose from 'essentials', 'savings', or 'discretionary_spending'.")

    def calculate_monthly_budget(self):
        total_income = self.income
        essentials_budget = total_income * self.essentials_percentage
        savings_budget = total_income * self.savings_percentage
        discretionary_spending_budget = total_income * self.discretionary_spending_percentage

        return essentials_budget, savings_budget, discretionary_spending_budget

    def track_expenses(self):
        print("Current budget summary:")
        for category, expenses in self.expenses.items():
            total_amount = sum([expense.amount for expense in expenses])
            print(f"{category}: ${total_amount}/${getattr(self, f'{category}_budget')} ")

