        total_spent = sum([expense.amount for expenses in self.expenses.values() for expense in expenses])
        print(f"Total income: ${self.income}")
        print(f"Total spent: ${total_spent}")
        remaining_balance = self.income - total_spent
        print(f"Remaining balance: ${remaining_balance}\n")

